script: |
  super -f text -I q9575.spq | sort > q9575.out

inputs:
  - name: q9575.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE CAST ( - + 0 AS REAL ) / + - ( + 95 ) + + + col0 BETWEEN + col2 + - 98 * + 57 AND NULL;
  - name: tab0

outputs:
  - name: q9575.out
    data: |
